import React from 'react';
import axios from 'axios';

function ExcelExport() {
  function handleSubmit(e) {
    e.preventDefault();
    const form = e.target;
    const formData = new FormData(form);

    axios.post('https://script.google.com/macros/s/AKfycbxfEph-j-5ELfvRhnZchIVuxTo1ZvdrhxucKOhviDM0tqrV9preBWXL-03tiaAsSHgAwQ/exec', formData)
      .then(response => {
        console.log(response.data);
        // Handle success response
      })
      .catch(error => {
        console.error('Error submitting data:', error);
        // Handle error response
      });
  }

  return (
    <div className="index-content">
      <div id="container"></div>
      <div className="labelainput">
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="fullName">ชื่อ-สกุล:</label>
            <input type="text" id="fullName" name="fullName" />
          </div>
          <div>
            <label htmlFor="stdid">รหัสนักศึกษา:</label>
            <input type="number" id="stdid" name="stdid" />
          </div>
          <div>
            <label htmlFor="level">ชั้นปี:</label>
            <select id="level" name="level">
              <option value="ชั้นปีที่ 1">ชั้นปีที่ 1</option>
              <option value="ชั้นปีที่ 2">ชั้นปีที่ 2</option>
              <option value="ชั้นปีที่ 3">ชั้นปีที่ 3</option>
              <option value="ชั้นปีที่ 4">ชั้นปีที่ 4</option>
            </select>
          </div>
          <div>
            <label htmlFor="subj">หลักสูตร:</label>
            <select id="subj" name="subj">
              {/* Options for courses */}
            </select>
          </div>
          <div>
            <label htmlFor="about">ฝ่ายที่สนใจ:</label>
            <select id="about" name="about">

</select>
          </div>
          <input className="custom-btn btn-15" value="Submit" type="submit" />
        </form>
      </div>
      <h4>โปรดกรอกข้อมูลตามความเป็นจริง</h4>
    </div>
  );
}

export default ExcelExport;
